export default function Header() {
    return (
        <>
            <div className="entrance neonText">
                Hey, I'm Michael.<br />
                I like dogs.<span className="float-right"><img src="./images/self.png" alt="self portrait" height="300rem" width="300rem" />
                </span>
            </div>

        </>
    )
}
